        <input type="radio" name="priority"/>
        <span class="add__circle"></span>
      </label>
      <label class="add__radio add__radio--2" title="Priority 2">
        <input type="radio" name="priority"/>
        <span class="add__circle"></span>
      </label>
      <label class="add__radio add__radio--3" title="Priority 3">
        <input type="radio" name="priority"/>
        <span class="add__circle"></span>
      </label>
    </div>
    <input placeholder="+ Add todo item" type="text" class="add__input"/>
  </div>
  <ul class="list">

  {todos.map(todo => (
    <li class="item" key={todo._id}>
      <label class="item__checkbox item__checkbox--3"><input type="checkbox"/><i class="fas fa-check"></i></label>{todo_}<button class="item__delete"><i class="fas fa-trash-alt"></i></button></li>
